@halliemeyer and her ice cream team are still knocking it out of the ice cream ballpark with her outstanding ice creams at @caffepanna. After I polished off a chocolate affogato with whipped cream on my own, we shared a tasting of flavors that included camomile, mint Oreo, a fabulous blackberry corn ice cream with salted buttered pecans (my favorite!) and more. But you can never have enough ice cream…right?😃
